import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import UndoIcon from '@material-ui/icons/Undo';
import RedoIcon from '@material-ui/icons/Redo';


const styles = theme => ({
    history: {
        marginLeft: 'auto',
    },
    enabled:{
	color:'black',
    },
    disabled:{
	color:'gray',
    },
});
class History extends Component {
    state = {anchorEl: null,};
    render() {
        const { classes, state } = this.props;
	this.undoClick = event => {state.Navigate.undo(state)};
	this.redoClick = event => {state.Navigate.redo(state)};
	this.onClose = () => {this.setState();};
	var disundo= state.Navigate.canUndo(state);
	var disredo= state.Navigate.canRedo(state);
	console.log("############### Disabled:",disundo, disredo);
	return (
		<div className={classes.history}>
		 <Button 
	            disabled={disundo}
                    onClick={this.undoClick}
		   >
		   {<UndoIcon/>}
                 </Button>
		 <Button 
	            disabled={disredo}
                    onClick={this.redoClick}
		   >
		   {<RedoIcon/>}
                 </Button>
		</div>
	);
    }
}

History.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(History);
